import "./mine.css";
import Tips from "./components/tips/tip";
import { useNavigate } from 'react-router-dom';
import {login} from"../login/api/api";
function mine(props) {
    const tipItem = props.tipsData.map((item, index) => <Tips index={index} key={item.id} id={item.id} pic={item.Image} desc={item.desc} />);
    const navigate = useNavigate();
    function moreinfoHandler() {
        navigate('/profile/')
    };
    return (
        <div className="mine-bg">
            <div id="self-info">
                <div id="avatar"><img src={require("../mine/minepic/avatar.jpg")} id="avapic"/></div>
                <div id="self-intro">{login()}<p id="stu-num">2022214959</p></div>
                <button id="more-info" onClick={moreinfoHandler}>详情</button>
                <div id="arrow"></div>
            </div>
            <div id="morefunc">
                {tipItem}
            </div>
            <div id="tabbar">
                <div id="timetab">
                    <img src={require("./minepic/timetable.png")} id="timepic" className="tabpic" />
                    <p className="tabp">课表</p>
                </div>
                <div id="home">
                    <img src={require("./minepic/home.png")} id="homepic" className="tabpic" />
                    <p className="tabp">首页</p>
                </div>
                <div id="mine">
                    <img src={require("./minepic/mine.png")} id="minepic" className="tabpic" />
                    <p className="tabp" id="minetab">我的</p>
                </div>
            </div>
        </div>
    )
}
export default mine;
